INSERT INTO `blog` VALUES (65,'测试文章','<div><p style=\"box-sizing: border-box; margin-bottom: 10px; font-size: 18px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; background-color: rgb(245, 245, 245);\">ZeroTier是一款基于P2P的内网穿透工具，对于个人免费且支持最多100台设备端对端穿透，看上去很优秀。出于爱折腾的兴趣，就安装试用一下。</p><p style=\"box-sizing: border-box; margin-bottom: 10px; font-size: 18px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; background-color: rgb(245, 245, 245);\">首先在官网注册帐号并创建一个虚拟网，得到虚拟网ID。</p><p style=\"box-sizing: border-box; margin-bottom: 10px; font-size: 18px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; background-color: rgb(245, 245, 245);\">然后下载Windows安装包，在Windows上一路确定安装完毕，点击运行，右键托盘图标选择join，填写上新建的虚拟网ID，进行加入。加入后点击”show networks”查看网络状态，发现Status为”PORT_ERROR”，这肯定是不正常的。</p></div> ',1,'testNews',1628175158,1628175158),(66,'测试','<div><img class=\"inertImage\" src=\"data:image/jpeg;base64,\" style=\"width: auto; height: auto;\"><br></div> ',0,'testImg',1628175233,1628175233),(67,'测试','<div>asd<img class=\"inertImage\" src=\"data:image/jpeg;base64,\" style=\"width: auto; height: auto;\"><br></div> ',0,'testImg',1628232474,1628232474),(68,'买了台任天堂Switch','<div><p style=\"box-sizing: border-box; margin-bottom: 10px; font-size: 18px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; background-color: rgb(245, 245, 245);\">年前腊月28，趁着海关还能正常清关，赶紧下单了台日版switch，体验一下新潮的数码产品。。。</p><p style=\"box-sizing: border-box; margin-bottom: 10px; font-size: 18px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; background-color: rgb(245, 245, 245);\">某东全球购自营购入，不得不称赞一下某东的速度是真的牛逼飞起，两天时间下单到清关完成，两天半的小时物流配送，到初二上午配送，一共五天时间到手！</p><span id=\"more-2890\" style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(245, 245, 245);\"></span><figure class=\"wp-block-image size-large\" style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(245, 245, 245);\"><img loading=\"lazy\" width=\"500\" height=\"552\" src=\"https://www.zh30.com/wp-content/uploads/2021/02/switch_1.png\" alt=\"\" class=\"wp-image-2901 img-responsive center-block\" srcset=\"https://www.zh30.com/wp-content/uploads/2021/02/switch_1.png 500w, https://www.zh30.com/wp-content/uploads/2021/02/switch_1-272x300.png 272w\" sizes=\"(max-width: 500px) 100vw, 500px\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; display: block; max-width: 100%; height: auto; margin-left: auto; margin-right: auto;\"></figure><p style=\"box-sizing: border-box; margin-bottom: 10px; font-size: 18px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; background-color: rgb(245, 245, 245);\">香港地区是使用的永利八达通物流，所以包装上除了京东仓的面单外，还会有八达通的快递单。</p><figure class=\"wp-block-image size-large\" style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(245, 245, 245);\"><img loading=\"lazy\" width=\"500\" height=\"500\" src=\"https://www.zh30.com/wp-content/uploads/2021/02/switch_2.png\" alt=\"\" class=\"wp-image-2903 img-responsive center-block\" srcset=\"https://www.zh30.com/wp-content/uploads/2021/02/switch_2.png 500w, https://www.zh30.com/wp-content/uploads/2021/02/switch_2-300x300.png 300w, https://www.zh30.com/wp-content/uploads/2021/02/switch_2-150x150.png 150w\" sizes=\"(max-width: 500px) 100vw, 500px\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; display: block; max-width: 100%; height: auto; margin-left: auto; margin-right: auto;\"></figure><p style=\"box-sizing: border-box; margin-bottom: 10px; font-size: 18px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; background-color: rgb(245, 245, 245);\">快递纸盒内只有一圈气囊防震。</p><figure class=\"wp-block-image size-large\" style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(245, 245, 245);\"><img loading=\"lazy\" width=\"500\" height=\"500\" src=\"https://www.zh30.com/wp-content/uploads/2021/02/switch_3.png\" alt=\"\" class=\"wp-image-2904 img-responsive center-block\" srcset=\"https://www.zh30.com/wp-content/uploads/2021/02/switch_3.png 500w, https://www.zh30.com/wp-content/uploads/2021/02/switch_3-300x300.png 300w, https://www.zh30.com/wp-content/uploads/2021/02/switch_3-150x150.png 150w\" sizes=\"(max-width: 500px) 100vw, 500px\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; display: block; max-width: 100%; height: auto; margin-left: auto; margin-right: auto;\"></figure><p style=\"box-sizing: border-box; margin-bottom: 10px; font-size: 18px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; background-color: rgb(245, 245, 245);\">红色纸盒的续航增强版，也是目前最常见的版本了。。。</p><figure class=\"wp-block-image size-large\" style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(245, 245, 245);\"><img loading=\"lazy\" width=\"500\" height=\"500\" src=\"https://www.zh30.com/wp-content/uploads/2021/02/switch_4.png\" alt=\"\" class=\"wp-image-2905 img-responsive center-block\" srcset=\"https://www.zh30.com/wp-content/uploads/2021/02/switch_4.png 500w, https://www.zh30.com/wp-content/uploads/2021/02/switch_4-300x300.png 300w, https://www.zh30.com/wp-content/uploads/2021/02/switch_4-150x150.png 150w\" sizes=\"(max-width: 500px) 100vw, 500px\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; display: block; max-width: 100%; height: auto; margin-left: auto; margin-right: auto;\"></figure><p style=\"box-sizing: border-box; margin-bottom: 10px; font-size: 18px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; background-color: rgb(245, 245, 245);\">上翻盖开盒后，是很简单的纸壳内衬，不像手机包装那样华丽丝般顺滑。</p><figure class=\"wp-block-image size-large\" style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(245, 245, 245);\"><img loading=\"lazy\" width=\"500\" height=\"500\" src=\"https://www.zh30.com/wp-content/uploads/2021/02/switch_6.png\" alt=\"\" class=\"wp-image-2906 img-responsive center-block\" srcset=\"https://www.zh30.com/wp-content/uploads/2021/02/switch_6.png 500w, https://www.zh30.com/wp-content/uploads/2021/02/switch_6-300x300.png 300w, https://www.zh30.com/wp-content/uploads/2021/02/switch_6-150x150.png 150w\" sizes=\"(max-width: 500px) 100vw, 500px\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; display: block; max-width: 100%; height: auto; margin-left: auto; margin-right: auto;\"></figure><p style=\"box-sizing: border-box; margin-bottom: 10px; font-size: 18px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; background-color: rgb(245, 245, 245);\">透明包装袋内的switch主机，两码正常，另一码在内衬纸壳的侧面，刚开始在外壳没找到，以为商家忘了贴。。。闻上去有很强的新机器特殊的味道。</p><figure class=\"wp-block-image size-large\" style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(245, 245, 245);\"><img loading=\"lazy\" width=\"500\" height=\"500\" src=\"https://www.zh30.com/wp-content/uploads/2021/02/switch_5.png\" alt=\"\" class=\"wp-image-2907 img-responsive center-block\" srcset=\"https://www.zh30.com/wp-content/uploads/2021/02/switch_5.png 500w, https://www.zh30.com/wp-content/uploads/2021/02/switch_5-300x300.png 300w, https://www.zh30.com/wp-content/uploads/2021/02/switch_5-150x150.png 150w\" sizes=\"(max-width: 500px) 100vw, 500px\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; display: block; max-width: 100%; height: auto; margin-left: auto; margin-right: auto;\"></figure><p style=\"box-sizing: border-box; margin-bottom: 10px; font-size: 18px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; background-color: rgb(245, 245, 245);\">掏空包装盒后的全家福，包括switch主机、两副joycon手柄、两副手柄腕带、充电器、HDMI线、底座、joycon手柄握把。</p><figure class=\"wp-block-image size-large\" style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(245, 245, 245);\"><img loading=\"lazy\" width=\"500\" height=\"500\" src=\"https://www.zh30.com/wp-content/uploads/2021/02/switch_7.png\" alt=\"\" class=\"wp-image-2908 img-responsive center-block\" srcset=\"https://www.zh30.com/wp-content/uploads/2021/02/switch_7.png 500w, https://www.zh30.com/wp-content/uploads/2021/02/switch_7-300x300.png 300w, https://www.zh30.com/wp-content/uploads/2021/02/switch_7-150x150.png 150w\" sizes=\"(max-width: 500px) 100vw, 500px\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; display: block; max-width: 100%; height: auto; margin-left: auto; margin-right: auto;\"></figure><p style=\"box-sizing: border-box; margin-bottom: 10px; font-size: 18px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; background-color: rgb(245, 245, 245);\">收货前一天顺便买的内存卡和一张钢化膜，听说switch屏幕容易花，膜算是必需品，128G内存卡前期免费够用，毕竟没那么多钱下载数字版。。。</p><figure class=\"wp-block-image size-large\" style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(245, 245, 245);\"><img loading=\"lazy\" width=\"500\" height=\"500\" src=\"https://www.zh30.com/wp-content/uploads/2021/02/switch_8.png\" alt=\"\" class=\"wp-image-2909 img-responsive center-block\" srcset=\"https://www.zh30.com/wp-content/uploads/2021/02/switch_8.png 500w, https://www.zh30.com/wp-content/uploads/2021/02/switch_8-300x300.png 300w, https://www.zh30.com/wp-content/uploads/2021/02/switch_8-150x150.png 150w\" sizes=\"(max-width: 500px) 100vw, 500px\" style=\"box-sizing: border-box; border: 0px; vertical-align: middle; display: block; max-width: 100%; height: auto; margin-left: auto; margin-right: auto;\"></figure><p style=\"box-sizing: border-box; margin-bottom: 10px; font-size: 18px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; background-color: rgb(245, 245, 245);\">主机开机后按步骤走，过程中会提示插入手柄，插好手柄后的瞬间屏幕会亮起红色nintendo动画。</p><p style=\"box-sizing: border-box; margin-bottom: 10px; font-size: 18px; color: rgb(51, 51, 51); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; background-color: rgb(245, 245, 245);\">Nintendo做的这系统交互是真的棒，声音、震动和动画等都做的很细致，交互体验很不错，也可能是我对这种数码产品用的不多。switch插上手机做为掌机使用，拿着还是稍有分量的而且比较宽，习惯了横屏玩手机需要适应一段时间。手柄的手感一般，总感觉怕按坏了，下载了个马里奥兄弟35和tetris99 玩了一会儿，总感觉会按坏。（游戏很硬核）</p></div> ',3,'分享经验',1628239236,1628239236),(69,'特使','<div>阿大数据的卡拉斯京端口将阿斯利康的将阿拉斯加的辣椒似的</div> ',0,'测试111',1628242324,1628242324),(70,'特使2222','<div><u>22222阿大数据的卡拉斯京端口将阿斯利康的将阿拉斯加的辣椒似的</u></div> ',0,'测试1222',1628242342,1628242342),(71,'特使123123','<div><u>123231311的卡拉斯京端口将阿斯利康的将阿拉斯加的辣椒似的</u></div> ',1,'测试1',1628242351,1628242351),(72,'特使大撒粉','<div><u>asdasdasdas的卡拉斯京端口将阿斯利康的将阿拉斯加的辣椒似的</u></div> ',0,'测试123123',1628242359,1628242359),(73,'adsasd','<div>asdasd</div> ',1,'asdad',1628242372,1628242372),(74,'asdad af asf ad','<div>asda das 阿斯顿爱上多少啊大叔</div> ',0,'123',1628242380,1628242380),(75,'asd123','<div>asd12312312</div> ',0,'aaa',1628242389,1628242389),(77,'test','<h1><b>test</b></h1> ',8,'test1,test2',1628304872,1628304872),(78,'又是测试','<div>测试一哦</div> ',1,'test1',1628405226,1628405226);
